import React,{PureComponent} from 'react';
const styl={
    color:"blue",
    fontsize:"100px"
}
class PureComp extends PureComponent{
    render(){
        return(
            <div style={styl} >
              Welcome to PureComp
            </div>
        )
    }
}

export default PureComp;
